pragma solidity >=0.4.24;

pragma experimental ABIEncoderV2;

import "../lib/Ownable.sol";
import "../ens/ENS.sol";
import "../companyregistry/KomgoMetaResolver.sol";
import "../companyregistry/KomgoRegistrar.sol";
import "../companyregistry/KomgoResolver.sol";

contract KomgoOnboarder is Ownable {
    // namehash komgometaresolver.contract.komgo
    bytes32 KOMGO_META_RESOLVER_NODE = 0x255fa55edcca0b83c72d43f3a4b090aec6b7de747c9df042d56b2c3b6d97a873;
    // namehash meta.komgo
    bytes32 KOMGO_META_NODE = 0x9c19ca3566862e19c7779f1af09f5b2883d8880917cedcbf4ae505a775fa518a;
    // namehash komgoregistrar.contract.komgo
    bytes32 KOMGO_REGISTRAR_NODE = 0x56153f5af74cd5af058095635c60e6cff57544a8dd167ebebd5331bf3ccfceec;

    struct MessagingPubKey {
        string key;
        uint termDate;
        bool isEmpty;
    }

    struct PublicKey {
        bytes32 x;
        bytes32 y;
    }

    struct EthPubKey {
        PublicKey publicKey;
        uint termDate;
        bool isEmpty;
    }

    struct TextEntry {
        string key;
        string value;
    }

    struct TextEntryUpdate {
        bytes32 node;
        TextEntry[] textEntries;
    }

    struct OnboardingInformation {
        bytes32 staticIdHashed;
        EthPubKey ethPubKey;
        TextEntry[] textEntries;
        MessagingPubKey komgoMessagingPubKey;
        MessagingPubKey vaktMessagingPubKey;
    }

    ENS ens;

    KomgoMetaResolver public komgoMetaResolver;

    KomgoRegistrar public komgoRegistrar;

    constructor(address _ensAddress) public {
        ens = ENS(_ensAddress);
        address resolverAddress = ens.resolver(KOMGO_META_RESOLVER_NODE);
        require(resolverAddress != address(0), "Invalid resolver address");
        KomgoResolver komgoResolver = KomgoResolver(resolverAddress);
        address metaResolverAddress = komgoResolver.addr(KOMGO_META_RESOLVER_NODE);
        require(metaResolverAddress != address(0), "Invalid meta resolver address");
        komgoMetaResolver = KomgoMetaResolver(metaResolverAddress);

        address registrarAddress = komgoResolver.addr(KOMGO_REGISTRAR_NODE);
        require(registrarAddress != address(0), "Invalid registrar address");
        komgoRegistrar = KomgoRegistrar(registrarAddress);
    }

    function addCompanyOnboardingInformation(OnboardingInformation memory _onboardInfo) public onlyOwner() returns(bool){
        bytes32 node =  keccak256(abi.encodePacked(KOMGO_META_NODE, _onboardInfo.staticIdHashed));
        registerCompanyNode(_onboardInfo.staticIdHashed, node, address(this));
        addEthereumPublicKey(node, _onboardInfo.ethPubKey);
        addTextEntries(node, _onboardInfo.textEntries);
        addVaktMessagingPublicKey(node, _onboardInfo.vaktMessagingPubKey);
        addKomgoMessagingPublicKey(node, _onboardInfo.komgoMessagingPubKey);
        return true;
    }

    function addCompaniesOnboardingInformation(OnboardingInformation[] memory _onboardInformation) public onlyOwner() returns(bool) {
        require(_onboardInformation.length > 0, "Invalid number of company information");
        uint256 arrayLength = _onboardInformation.length;
        for (uint256 i = 0; i < arrayLength; i++) {
            addCompanyOnboardingInformation(_onboardInformation[i]);
        }
        return true;
    }

    function addEthereumPublicKey(bytes32 _node, EthPubKey memory _ethPubKey) public onlyOwner() returns(bool) {
        if (_ethPubKey.isEmpty) {
            return false;
        }
        bytes32 xPublicKey = _ethPubKey.publicKey.x;
        bytes32 yPublicKey = _ethPubKey.publicKey.y;
        uint termDate = _ethPubKey.termDate;
        komgoMetaResolver.addEthereumPublicKey(_node, xPublicKey, yPublicKey, termDate);
        return true;
    }

    function addTextEntries(bytes32 _node, TextEntry[] memory _textEntries) public onlyOwner() {
        uint256 entriesLength = _textEntries.length;
        for (uint256 i = 0; i < entriesLength; i++) {
            komgoMetaResolver.setText(_node, _textEntries[i].key, _textEntries[i].value);
        }
    }

    function setTextEntriesBatch(TextEntryUpdate[] memory _updates) public onlyOwner() {
        uint256 entriesLength = _updates.length;
        require(entriesLength > 0, "Invalid number of company information updates");
        for (uint256 i = 0; i < entriesLength; i++) {
            addTextEntries(_updates[i].node, _updates[i].textEntries);
        }
    }

    function registerCompanyNode(bytes32 _staticIdHashed, bytes32 _node, address _ownerAddress) public onlyOwner() {
        komgoRegistrar.registerAndSetResolvers(_staticIdHashed, _ownerAddress);
        ens.setOwner(_node, _ownerAddress);
    }

    function addVaktMessagingPublicKey(bytes32 _node, MessagingPubKey memory _messagingPubKey) public onlyOwner() returns(bool) {
        if (_messagingPubKey.isEmpty) {
            return false;
        }
        uint termDate = _messagingPubKey.termDate;
        komgoMetaResolver.addVaktMessagingPublicKey(_node, _messagingPubKey.key, termDate);
        return true;
    }

    function setVaktMessgingPublicKey(bytes32 _node, MessagingPubKey memory _messagingPubKey, TextEntry[] memory _textEntries) public onlyOwner() {
        addVaktMessagingPublicKey(_node, _messagingPubKey);
        addTextEntries(_node, _textEntries);
    }

    function revokeVaktMessagingPublicKey(bytes32 _node) public onlyOwner() {
        komgoMetaResolver.revokeVaktMessagingPublicKey(_node, komgoMetaResolver.vaktMessagingPublicKeysLength(_node) - 1);
        TextEntry[] memory nulledEntries = new TextEntry[](2);
        nulledEntries[0] = TextEntry("vaktStaticId", "");
        nulledEntries[1] = TextEntry("vaktMnid", "");
        addTextEntries(_node, nulledEntries);
    }

    function addKomgoMessagingPublicKey(bytes32 _node, MessagingPubKey memory _messagingPubKey) public onlyOwner() returns(bool) {
        if (_messagingPubKey.isEmpty) {
            return false;
        }
        uint termDate = _messagingPubKey.termDate;
        komgoMetaResolver.addKomgoMessagingPublicKey(_node, _messagingPubKey.key, termDate);
        return true;
    }

    function transferCompanyNodes(bytes32[] _nodes, address _newOwner) public onlyOwner() {
        for (uint256 i = 0; i < _nodes.length; i++) {
            ens.setOwner(_nodes[i], _newOwner);
        }
    }

    function transferRegistrarOwnership(address _newOwner) public onlyOwner() {
        komgoRegistrar.transferOwnership(_newOwner);
    }
}
